import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { FiUser, FiBookOpen, FiTarget, FiHeart } from 'react-icons/fi';

const StoryContainer = styled.div`
  min-height: 100vh;
  padding: 120px 20px 60px;
  background: ${props => props.theme.background};
`;

const StoryContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
`;

const StoryHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: 4rem;
`;

const StoryTitle = styled.h1`
  font-size: clamp(2.5rem, 5vw, 4rem);
  font-weight: 700;
  background: linear-gradient(-45deg, ${props => props.theme.primary}, ${props => props.theme.secondary}, ${props => props.theme.accent});
  background-size: 400% 400%;
  animation: gradient 3s ease infinite;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  margin-bottom: 1rem;
`;

const StorySubtitle = styled.p`
  font-size: 1.2rem;
  color: ${props => props.theme.textSecondary};
  max-width: 600px;
  margin: 0 auto;
  line-height: 1.6;
`;

const StorySection = styled(motion.div)`
  margin-bottom: 4rem;
  padding: 2rem;
  background: ${props => props.theme.surface};
  border-radius: 20px;
  border: 1px solid ${props => props.theme.border};
  box-shadow: 0 10px 30px ${props => props.theme.shadow};
`;

const SectionHeader = styled.div`
  display: flex;
  align-items: center;
  gap: 1rem;
  margin-bottom: 1.5rem;
`;

const SectionIcon = styled.div`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  background: linear-gradient(135deg, ${props => props.theme.primary}, ${props => props.theme.secondary});
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 1.5rem;
`;

const SectionTitle = styled.h2`
  font-size: 1.8rem;
  color: ${props => props.theme.text};
  margin: 0;
`;

const SectionContent = styled.div`
  color: ${props => props.theme.textSecondary};
  line-height: 1.7;
  font-size: 1.1rem;
`;

const Timeline = styled.div`
  position: relative;
  padding-left: 2rem;

  &::before {
    content: '';
    position: absolute;
    left: 0;
    top: 0;
    bottom: 0;
    width: 2px;
    background: linear-gradient(to bottom, ${props => props.theme.primary}, ${props => props.theme.secondary});
  }
`;

const TimelineItem = styled.div`
  position: relative;
  margin-bottom: 2rem;
  padding-left: 2rem;

  &::before {
    content: '';
    position: absolute;
    left: -1.5rem;
    top: 0.5rem;
    width: 12px;
    height: 12px;
    border-radius: 50%;
    background: ${props => props.theme.accent};
    border: 3px solid ${props => props.theme.background};
  }
`;

const TimelineYear = styled.div`
  font-weight: 600;
  color: ${props => props.theme.primary};
  font-size: 1.1rem;
  margin-bottom: 0.5rem;
`;

const TimelineText = styled.p`
  color: ${props => props.theme.textSecondary};
  margin: 0;
`;

const MyStory = ({ theme }) => {
  return (
    <StoryContainer theme={theme}>
      <StoryContent>
        <StoryHeader
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <StoryTitle theme={theme}>My Story</StoryTitle>
          <StorySubtitle theme={theme}>
            From passion to profession - here's the journey that shaped me into the developer I am today.
          </StorySubtitle>
        </StoryHeader>

        <StorySection
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
          theme={theme}
        >
          <SectionHeader>
            <SectionIcon theme={theme}>
              <FiUser />
            </SectionIcon>
            <SectionTitle theme={theme}>Who I Am</SectionTitle>
          </SectionHeader>
          <SectionContent theme={theme}>
            I'm a passionate full-stack developer and AI engineer with a love for creating innovative digital experiences. 
            My journey in technology began with curiosity and has evolved into a career of building solutions that make a difference.
            When I'm not coding, you'll find me exploring new technologies, contributing to open-source projects, or sharing knowledge with the developer community.
          </SectionContent>
        </StorySection>

        <StorySection
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          theme={theme}
        >
          <SectionHeader>
            <SectionIcon theme={theme}>
              <FiBookOpen />
            </SectionIcon>
            <SectionTitle theme={theme}>My Journey</SectionTitle>
          </SectionHeader>
          <Timeline theme={theme}>
            <TimelineItem>
              <TimelineYear theme={theme}>2020 - Present</TimelineYear>
              <TimelineText theme={theme}>
                Working as a full-stack developer, specializing in modern web technologies and AI integration.
              </TimelineText>
            </TimelineItem>
            <TimelineItem>
              <TimelineYear theme={theme}>2018 - 2020</TimelineYear>
              <TimelineText theme={theme}>
                Started my journey in software development, learning various programming languages and frameworks.
              </TimelineText>
            </TimelineItem>
            <TimelineItem>
              <TimelineYear theme={theme}>2016 - 2018</TimelineYear>
              <TimelineText theme={theme}>
                Discovered my passion for technology and began exploring the world of programming.
              </TimelineText>
            </TimelineItem>
          </Timeline>
        </StorySection>

        <StorySection
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.6 }}
          theme={theme}
        >
          <SectionHeader>
            <SectionIcon theme={theme}>
              <FiTarget />
            </SectionIcon>
            <SectionTitle theme={theme}>My Mission</SectionTitle>
          </SectionHeader>
          <SectionContent theme={theme}>
            I believe technology should be accessible, intuitive, and impactful. My mission is to create digital solutions 
            that not only solve problems but also delight users. Whether it's building responsive websites, developing 
            AI-powered applications, or crafting seamless user experiences, I'm committed to delivering excellence in every project.
          </SectionContent>
        </StorySection>

        <StorySection
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.8 }}
          theme={theme}
        >
          <SectionHeader>
            <SectionIcon theme={theme}>
              <FiHeart />
            </SectionIcon>
            <SectionTitle theme={theme}>What Drives Me</SectionTitle>
          </SectionHeader>
          <SectionContent theme={theme}>
            Innovation, continuous learning, and making a positive impact through technology. I'm constantly exploring 
            new frameworks, methodologies, and emerging technologies to stay at the forefront of the industry. 
            Every challenge is an opportunity to grow, and every project is a chance to create something meaningful.
          </SectionContent>
        </StorySection>
      </StoryContent>
    </StoryContainer>
  );
};

export default MyStory;
